import axios from "axios";

axios.defaults.baseURL = "http://api.fsn365.com";

export const blocksList = () => {
  return axios({
    method: "get",
    headers: {
      "Content-Type": "application/x-www-form-urlencoded;charset=UTF-8",
      "Access-Control-Allow-Origin": "*",
    },
    url: "/blocks",
  });
};
